import React, { useEffect } from "react";
import { setMovieKeyword } from "../../slices/AppSlice";
import { fetchData, fetchDetails } from "../../utils/utils";
import { useDispatch, useSelector } from "react-redux";
import { useParams } from "react-router-dom";

const Keywords = () => {
  const dispatch = useDispatch();
  const { id } = useParams();
  useEffect(() => {
    async function fetchDataFunction() {
      const result = await fetchData(`movie/${id}/keywords`);
      dispatch(setMovieKeyword(result));
    }

    fetchDataFunction();
  }, [id]);

  const keyword = useSelector((state) => state.app.movieKeyword.data);

  return <div>Keywords</div>;
};

export default Keywords;
